import styled from "styled-components"
import { Facebook, Instagram, MailOutline, Phone, Pinterest, Room, Twitter } from "@material-ui/icons"

const Container = styled.div`
    width: 100vw;
    height: 100vh;
    /* background: linear-gradient( rgba(255, 255, 255, 0.5), rgba(255, 255, 255, 0.5) ),url("https://images.pexels.com/photos/6984650/pexels-photo-6984650.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940") center; */
    background: linear-gradient( rgba(255, 255, 255, 0.5), rgba(255, 255, 255, 0.5) ),url("https://img.freepik.com/free-vector/sports-nutrition-poster_1284-71965.jpg?w=1380&t=st=1680864665~exp=1680865265~hmac=1c3bff31c56804a10464810ab4010f866ff4ae58ea3ac589e8cacb0d5f10cdef") center;
    background-size: cover;
    display: flex;
    /* align-items: center;
    justify-content: flex-start; */
    position: relative;
    
`

const Wrapper = styled.div`
    width: 25%;
    padding: 20px;
    background-color: white;
    position: absolute;
    top: 50px;
    left: 65px;
`

const Title = styled.h1`
    font-size: 24px;
    font-weight: 300;
`

const Form = styled.form`
    display: flex;
    flex-direction: column;
`

const Input = styled.input`
    flex: 1;
    min-width: 40%;
    margin: 10px 0px;;
    padding: 10px;
`


const Button = styled.button`
    width: 40%;
    border: none;
    padding: 15px 20px;
    background-color: teal;
    color: white;
    cursor: pointer;
    margin-bottom: 10px;
`

const Link = styled.a`
    margin: 5px 0px;
    font-size: 12px;
    text-decoration: underline;
    cursor: pointer;
`

const InfoContainer =  styled.div`
    background-color: white;
    position: absolute;
    top: 680px;
    left: 65px;
    bottom: 100px;
    width: 30%;
    padding: 5px;
    //display: block;
    border-radius: 5px;
    
`
const InfoText = styled.p`
    padding: 15px 0;
    text-align: left;
    font-size: 24px;
    font-weight: 600;
    
`

const SocialContainer = styled.div`
    color: black;
    margin-right: 20px;
    display: flex;
`;


const Login = () => {
  return (

    <Container>
        <Wrapper>
            <Title>SIGN IN</Title>
            <Form>
                <Input placeholder="username"/>
                <Input placeholder="password" type="password"/>
                <Button>LOGIN</Button>
                <Link>DO NOT YOU REMEMBER THE PASSWORD?</Link>
                <Link>CREATE A NEW ACCOUNT</Link>
            </Form>
        </Wrapper>
        <InfoContainer>
            <InfoText>
                Reach us via:
            </InfoText>
            <SocialContainer>
                <Facebook />
                <Instagram />
                <Twitter />
                <Pinterest />
            </SocialContainer>
            
        </InfoContainer>
    </Container>
  )
}

export default Login
